import React from "react";
import Header from "../components/header/Header";
import BodyLayout from "../components/body/BodyLayout";
import Footer from "../components/footer/Footer";
import styled from "styled-components";
import { MenuTitle } from "../components/body/mixin/Mixin";

// 상단 프로필 섹션
const ProfileSummary = styled.section`
  width: 60vw;
  height: auto;
  display: flex;
  justify-content: space-evenly;
  border: 2px solid var(--color-yellow);
  border-radius: 4px;
`;

const Section = styled.section`
  display: flex;
  flex-direction: column;
  margin: calc(var(--margin-default) / 2);
`;

const UserIconSection = styled(Section)`
  align-items: center;
`;

const UserIcon = styled.div`
  width: 24vh;
  height: 24vh;
  margin: calc(var(--margin-default) / 4);
`;

const UserImage = styled.div`
  width: 100%;
  height: 100%;
  border-radius: 50%;
  overflow: hidden;
  img {
    width: 100%;
    height: 100%;
  }
`;

const UserInfoSection = styled(Section)`
  width: 72%;
  padding: var(--padding-default);
  display: flex;
  flex-direction: column;
  justify-content: center;
`;

const UserId = styled.div`
  font-size: var(--font-size-large);
`;
const UserInfo = styled.div`
  font-size: var(--font-size-normal);
`;

// 하단 메뉴 섹션
const MenuContainer = styled.section`
  width: 60vw;
  height: 40vh;
  margin-top: var(--margin-default);
  background-color: black;
  display: flex;
  flex-wrap: wrap;
  justify-content: space-between;
`;

const MenuBox = styled.div`
  width: 32%;
  height: 100%;
  background-color: white;
`;

const MyPage = () => {
  return (
    <>
      <Header />
      <BodyLayout>
        <MenuTitle>My Page</MenuTitle>
        <ProfileSummary>
          <UserIconSection>
            <UserIcon>
              <UserImage>
                <img src="images/user.jpg" alt="user" />
              </UserImage>
            </UserIcon>
          </UserIconSection>
          <UserInfoSection>
            <UserId>UserId will be here</UserId>
            <UserInfo>유저 정보가 뭐라도 필요한데</UserInfo>
            <UserInfo>뭘 넣어야 될까요?</UserInfo>
          </UserInfoSection>
        </ProfileSummary>

        <MenuContainer>
          <MenuBox>후기</MenuBox>
          <MenuBox>찜한 장소</MenuBox>
          <MenuBox>나의 추천 코스</MenuBox>
        </MenuContainer>
      </BodyLayout>
      <Footer />
    </>
  );
};

export default MyPage;
